import React from 'react';
import { Button, Grid } from '@material-ui/core';
import {
  createStyles,
  withStyles,
  makeStyles,
  Theme,
  ThemeProvider,
} from '@material-ui/core/styles';
import './Header.css';
import Toolbar from '@material-ui/core/Toolbar';


const ColorButton = withStyles((theme) => ({
  root: {
    color: "white",
    backgroundColor: "black",
    '&:hover': {
      backgroundColor: "black",
    },
    margin: "10px",
  },
}))(Button);

export default function Header() {
    return (
      <Toolbar className="toolbar">
        <Grid container spacing={0} className="grid" 
        alignItems="center"
        justify="flex-end">
            <Grid item xs={12} sm={6} className="images" style={{background: "red"}} justify="flex-start">
                <img src="/images/MathLaw.PNG"></img>
                <img src="/images/logo.PNG" style={{marginBottom: "33px", marginLeft: "30px"}}></img>
            </Grid>
            <Grid item xs={12} sm={6}>
                <ColorButton>Sign Up</ColorButton>
                <ColorButton>Log In</ColorButton>
            </Grid>
        </Grid>
      </Toolbar>

    );
}
